description:
Features the seven BBC concerts by Dr. Evadne Hinge and Dame Hilda Bracket. 


&quot;I defy anyone not to find something to smile about and the songs are in your head for days . I can't recommend this highly enough George Logan and Patrick Fyffe are brilliant it's just a shame that Patrick didn't live long enough to see all his hard work reach a new generation .They seem to enjoy themselves so much and even just watching it you want to join in with the singing.&quot;

